<tr style=""height: 17.35pt;"">
<td style=""width: 560.45pt; border-top-style: solid; border-top-width: 0.75pt; padding-right: 5.4pt");
                WriteLiteral(@"; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<p style=""margin-top: 0pt; margin-bottom: 0pt; font-size: 12pt;""><strong><span style=""font-family: 'Times New Roman';"">Tôi/Chúng tôi cam kết:</span></strong></p>
</td>
</tr>
<tr style=""height: 17.35pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<p style=""margin-top: 0pt; margin-bottom: 0pt; font-size: 12pt;""><strong><span style=""font-family: 'Times New Roman';"">I.</span></strong><strong><span style=""font-family: 'Times New Roman';"">&nbsp; </span></strong><strong><span style=""font-family: 'Times New Roman';"">VỀ KHOẢN VAY</span></strong></p>
</td>
</tr>
<tr style=""height: 0.35pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Những thông tin trên");
                WriteLiteral(@" đây là đúng sự thật và tôi/chúng tôi hoàn toàn chịu trách nhiệm về các thông tin đã cung cấp</li>
</ol>
</td>
</tr>
<tr style=""height: 0.35pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" start=""2"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tôi/chúng tôi đồng ý và cho phép Techcombank sử dụng bất kỳ thông tin nào trên Đề nghị này để chia sẻ và trao đổi những thông tin liên quan đến tôi/chúng tôi và khoản vay của tôi/chúng tôi; đồng thời đồng ý và cho phép Techcombank tìm kiếm, xác minh, cung cấp thông tin liên quan đến tôi/chúng tôi và khoản vay của tôi/chúng tôi từ/cho bất kỳ bên thứ ba nào khác theo các qui định của Techcombank. Ngoài ra, tôi cũng đồng ý rằng Techcombank có quyền sử dụng thông tin trên Đề nghị này để cung cấp, giới thiệu, hỗ trợ cho tôi/chúng tôi về các thông tin liên quan đến sản phẩm, dịc");
                WriteLiteral(@"h vụ của Techcombank.</li>
</ol>
</td>
</tr>
<tr style=""height: 0.5pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" start=""3"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tôi/Chúng tôi đồng ý và ủy quyền để Chủ Đầu Tư/Bên nhận đặt cọc giao cho Techcombank Bản gốc Thỏa Thuận Đặt Cọc/Ký Quỹ hoặc/và Hợp Đồng Mua Bán hoặc/và Văn Bản Chuyển Nhượng HĐMB.</li>
</ol>
</td>
</tr>
<tr style=""height: 0.5pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" start=""4"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tài sản bảo đảm thuộc quyền sở hữu hợp pháp của tôi/chúng tôi không có tranh chấp, không nằm trong khu vực giải toả, không");
                WriteLiteral(@" bị đem cầm cố, thế chấp, chuyển nhượng, chuyển đổi, tặng cho, cho thuê, góp vốn, định đoạt dưới bất cứ hình thức nào … hoặc đảm bảo cho việc thực hiện bất kỳ nghĩa vụ nào khác. Techcombank có toàn quyền xử lý tài sản bảo đảm để thu hồi nợ vay trong trường hợp tôi/chúng tôi không thực hiện hoặc thực hiện không đúng nghĩa vụ trả nợ đã cam kết.</li>
</ol>
</td>
</tr>
<tr style=""height: 0.4pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" start=""5"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Trong trường hợp không tiếp tục làm việc tại cơ quan nói trên, tôi/chúng tôi cam kết thông báo cho&nbsp; Techcombank trước thời hạn ...{ChangeJobNotifyDuration}.... ngày kể từ ngày chấm dứt và cam kết cùng gia đình sử dụng mọi nguồn thu nhập và tài sản của tôi/chúng tôi và gia đình chịu trách nhiệm trả hết nợ vay (cả gốc và lãi");
                WriteLiteral(@", phí) cho Techcombank.</li>
</ol>
</td>
</tr>
<tr style=""height: 0.25pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" start=""6"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Sử dụng vốn đúng mục đích vay. Trả gốc và lãi đầy đủ, đúng hạn.</li>
</ol>
</td>
</tr>
<tr style=""height: 8.15pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" start=""7"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tuân thủ đúng các quy định khác của&nbsp; Techcombank liên quan đến khoản vay của tôi/chúng tôi.</li>
</ol>
</td>
</tr>
<tr style=""height: 10.5pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-");
                WriteLiteral(@"align: top;"" colspan=""3"">
<ol style=""margin: 0pt; padding-left: 0pt;"" start=""8"" type=""1"">
<li style=""margin-left: 17.6pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Trong trường hợp chúng tôi vi phạm những cam kết trên, tôi/chúng tôi xin hoàn toàn chịu trách nhiệm trước pháp luật.</li>
</ol>
</td>
</tr>
<tr style=""height: 10.5pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<p style=""margin-top: 0pt; margin-bottom: 0pt; text-align: justify; font-size: 12pt;""><span style=""font-family: 'Times New Roman';"">&nbsp;</span></p>
</td>
</tr>
<tr style=""height: 10.5pt;"">
<td style=""width: 560.45pt; padding-right: 5.4pt; padding-left: 5.4pt; vertical-align: top;"" colspan=""3"">
<p style=""margin-top: 0pt; margin-right: 3.6pt; margin-bottom: 0pt; text-align: justify; font-size: 12pt;""><strong><span style=""font-family: 'Times New Roman';"">II.</span></strong><strong><span style=""font-family: 'Times New Ro");
                WriteLiteral(@"man';"">&nbsp; </span></strong><strong><span style=""font-family: 'Times New Roman';"">VỀ THẺ TÍN DỤNG</span></strong></p>
<ol style=""margin: 0pt; padding-left: 0pt;"" type=""1"">
<li style=""margin-right: 3.6pt; margin-left: 14pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tôi/chúng tôi đăng ký chữ ký mẫu (nếu có) sử dụng trong tất cả các giấy tờ, chứng từ&nbsp; giao dịch với Techcombank sau thời điểm đăng ký.</li>
<li style=""margin-right: 3.6pt; margin-left: 14pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tôi/chúng tôi xác nhận và hoàn toàn chịu trách nhiệm về các thông tin được cung cấp tại Đề nghị kiêm hợp đồng phát hành, sử dụng&nbsp; thẻ tín dụng quốc tế dành cho khách hàng cá nhân trên đây (“Đề nghị kiêm Hợp đồng”) là chính xác và xác thực, do chính tôi/chúng tôi kê khai và không có thông tin nào được cố ý che giấu.</li>
<li style=""margin-right: 3.6pt; margin-left: 14pt; text-align: justify; padding-left: 4pt; f");
                WriteLiteral(@"ont-family: 'Times New Roman'; font-size: 12pt;"">Tôi/chúng tôi đồng ý với Hạn mức thẻ tín dụng được phê duyệt sẽ được Techcombank thông báo tại tin nhắn kích hoạt thẻ tín dụng tới số điện thoại mà tôi đã đăng ký trong Đề nghị kiêm Hợp đồng này.</li>
<li style=""margin-right: 3.6pt; margin-left: 14pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tôi/chúng tôi đồng ý để Techcombank chủ động thay đổi hạn mức thẻ tín dụng của tôi theo tiêu chí xét duyệt hạn mức mà Techcombank áp dụng. Hạn mức tín dụng thay đổi (nếu có) sẽ được thể hiện tại tin nhắn thông báo mà Techcombank gửi tới số điện thoại mà tôi đã đăng ký trong Đề nghị kiêm Hợp đồng này.</li>
<li style=""margin-right: 3.6pt; margin-left: 14pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tôi/chúng tôi xác nhận đã được Techcombank giải thích rõ về các vấn đề liên quan đến lãi suất, cách tính lãi và nguyên tắc miễn lãi, biểu phí của thẻ tín dụng, bao gồm nhưng không giớ");
                WriteLiteral(@"i hạn bởi các loại phí và lãi suất bao gồm: Phí phát hành, phí thường niên, phí chậm thanh toán, lãi suất, cách tính lãi và nguyên tắc miễn lại của thẻ tín dụng</li>
<li style=""margin-right: 3.6pt; margin-left: 14pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Tôi/Chúng tôi xác nhận đã được Techcombank giải thích rõ về các trường hợp chuyển nợ quá hạn, áp dụng phí chậm thanh toán, chấm dứt sử dụng thẻ và thu hồi nợ theo quy định của Techcombank.</li>
<li style=""margin-right: 3.6pt; margin-left: 14pt; text-align: justify; padding-left: 4pt; font-family: 'Times New Roman'; font-size: 12pt;"">Bằng việc ký tên vào Đề nghị kiêm Hợp đồng này, Tôi/Chúng tôi xác nhận rằng đã đọc, hiểu rõ, đồng ý bị ràng buộc bởi các quy định trong bản Điều khoản, điều kiện về phát hành và sử dụng thẻ tín dụng tại Techcombank (áp dụng cho khách hàng cá nhân) và các biểu phí, lãi, đơn đề nghị khác phát sinh trong quá trình sử dụng thẻ. Tôi/Chúng tôi hiểu rằng bản Điều khoản, điều kiện này ");
